import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';  // Use 'Switch' instead of 'Routes'
import Home from './Home';
import Statistics from './Statistics';
import './index.css';

function App() {
  return (
    <Router>
      <div className="app">
        <h1>Image Dataset App</h1>
        <nav>
          <Link to="/">Home</Link> | <Link to="/statistics">Statistics</Link>
        </nav>

        <Switch>  {/* Replace 'Routes' with 'Switch' */}
          <Route exact path="/" component={Home} />
          <Route exact path="/statistics" component={Statistics} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
